```json
{
  "application": "MLMDA_DIRECT_SOLVER_3D_EFIE_NEW",
  "details": {
    "software": [
      "mpirun",
      "MLMDA_DIRECT_SOLVER_3D_EFIE_NEW"
    ],
    "resources": {
      "nodes": 1,
      "processors_per_node": 16,
      "memory": "3900mb",
      "walltime": "400:00:00",
      "queue": "flux",
      "OMP_THREADS": 8,
      "PBS_account": "vikramg_fluxoe"
    }
  }
}
```

This script is running the application **MLMDA_DIRECT_SOLVER_3D_EFIE_NEW**. It uses the **mpirun** command to run the application with 1 process across 1 node. The script also utilizes the **PBS** (Portable Batch System) to manage resources like nodes, processors per node, memory, walltime, and queue. The script sets the number of OpenMP threads to 8 using the **NUM_OMP_THREADS** environment variable. It also uses the **tee** command to write the output of the application to both the terminal and a file named "a.out".
